    "2015-09-01T18:24:20.084470",nt"name": "supplemental-nutrition-assistance-program-education-and-evaluation-study-wave-ii",nt"isopen":
    true,nt"url": null,nt"notes": "This study presents the evaluation of the
    three SNAP-Ed demonstration projects. Two of the three demonstration projects studied
    targeted low-income children in elementary school settings with the goal of increasing
    childrenu2019s consumption of fruits and vegetables. The third project also focused
    on increasing fruit and vegetable consumption and targeted seniors. One of the child-focused
    interventions and the Food and Nutrition Service (FNS) developed Eat Smart, Live
    Strong program for older Americans demonstrated increases in fruit and vegetable
    consumption. This study also evaluated the self-evaluations conducted by the three
    demonstration projects.",nt"license_title": "Creative Commons CCZero",nt"extras":
